    @classmethod
    def theURLMustBeValid(cls, murl, varnm="varnm"):
        if (varnm is None): return cls.theURLMustBeValid(murl, varnm="url");
        else:
            if (type(varnm) == str):
                if (len(varnm) < 3): return cls.theURLMustBeValid(murl, varnm="url");
            else: raise ValueError("the varnm must be a string!");

        merrmsg = "invalid " + varnm + "URL used here!";
        if (murl == None): raise ValueError(merrmsg);
        elif (type(murl) == str and 5 < len(murl)): return True;
        else: raise ValueError(merrmsg);

